    teams = {f'Team {i}': random.randint(0, 100) for i in range(1, number_teams + 1)}

    # Create an empty PriorityQueue and add the teams with their points as tuples
    queue = PriorityQueue()
    for team, points in teams.items():
        queue.put((-points, team))

    # Get the teams back from the PriorityQueue and return them as a sorted list
    sorted_teams = [queue.get()[1] for i in range(queue.qsize())]
